</div>
)
 }
  let object=obj.obj
 console.log(object)

 if(object.id){
    
    return(
<div className="productElement" onClick={showProduct}>
    <div>
        <img src="" alt="icon"/>
    </div>
    <div>
        <h4>{object.model}</h4>
        <h3>Цiна: {object.price}</h3>
    </div>
</div>
    ) 
 }else{
     return(
        <div className="sorry">
             <h1>Вибачте,на даний момент вiдсутнi товари в данiй категорiї</h1>
        </div>
     )
    
 }

 
 
}
export default ProductItem
